const TransactionHistory = ({ items }) => {
  return (
    <table class="transaction-history">
      <thead>
        <tr>
          <th>Type</th>
          <th>Amount</th>
          <th>Currency</th>
        </tr>
      </thead>

      {items.map(el => (
        <tbody>
          <tr>
            <td>{el.type}</td>
            <td>{el.amount}</td>
            <td>USD</td>
          </tr>
        </tbody>
      ))}
    </table>
  );
};

export default TransactionHistory;
